import Icon from "react-native-vector-icons/AntDesign" 
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  
    FirstView5,
    BigText4,
    SecondView4,
    PhotoView1,
    Quantity1,
    QtyText1,
    ButtonText1
} from "../componenets/fintech5Style"


export default function Fintech5({navigation}){
    return(
        <SafeAreaView style={styles.fintech5container}>
            <ScrollView>
                <FirstView5>
                <TouchableOpacity style={styles.back3} onPress={()=>navigation.navigate("Fintech2")}>
                   <Icon size={20} color="#C3AD60" name="back" style={styles.pad4}/> 
                    </TouchableOpacity>
                   <BigText4 style={styles.pad4}>Procurement</BigText4>
                </FirstView5>
                <SecondView4>
                <PhotoView1>
                    <Quantity1><QtyText1>Qty: 1</QtyText1><Icon name="caretdown" size={6} color="#fff"/></Quantity1>
                    <TextInput style={styles.link1} value="link"></TextInput>
                </PhotoView1>
                <TouchableOpacity style={styles.btn6}>
                    <ButtonText1>Submit</ButtonText1>
                </TouchableOpacity>
                </SecondView4>
            </ScrollView>
        </SafeAreaView>


)}

const styles = StyleSheet.create({
    fintech5container: {
        backgroundColor: "#000",
        paddingTop: 25,
        flex: 1,
    },
    back3: {
        padding: 10,
    },
    pad4: {
        paddingLeft: 40,
    },
    btn6: {
        height: 48,
        width: 340,
        borderRadius: 100,
        backgroundColor: "#C3AD60",
        marginTop: 270,
        alignItems: "center",
        justifyContent: "center",
    },
    link1: {
        height: 64,
        width: 340,
        backgroundColor: "#4E4E4E",
        color:"#fff",
        borderBottomLeftRadius: 20,
        borderBottomRightRadius: 20,
        position: "absolute",
        left: 0,
        top: 156,
        paddingLeft: 25
    
     }
});
